import styled from "styled-components";
import '../App.css';

export const Box = styled.div`
  width: 80%;
  height: 40%;
  background-color: white;
  border-radius: 10px;
  color: black;
  font-family: "openSansMedium";
`

export const ProfileText = styled.span`
  width: 100%;
  height: 100;
`
